import React from 'react';

const MapView = ({ trafficData }) => {
    return (
        <div>
            <h2>Map View</h2>
            {trafficData.map((data, index) => (
                <div key={index}>
                    <p>Timestamp: {data.timestamp}</p>
                    <p>Predicted Congestion Level: {data.predicted_congestion_level}</p>
                </div>
            ))}
        </div>
    );
};

export default MapView;
